import React,{Component} from 'react';
import Card from './card';
import img1 from '../images/ed.png'
import img2 from '../images/wordcloud.jpg'
import img3 from '../images/text_high.png'




class Cards extends Component{
    render(){
        return(
<div className="container-fluid d-flex justify-content-center">
    <div className="row">
        <div className="col-md-6">
        <Card imgsrc={img3} title="highlighted text" popup="jrkfnjk" popupDesc="Yessine aussi" link="./service1" />
        
        </div>
        <div className="col-md-6">
<Card imgsrc={img2} title="Word Cloud" link="./service2"/>
        </div>
       
    </div>
</div>
        );
    }
}
export default Cards;
